const App = ()=>{
    const [item , setItem] = useState
     return(
        <>
            <div>
                <label>Username</label><br/>
                <input type="text"></input><br/>
                <label>Age(Years)</label><br/>
                <input type="number"></input>
            </div>
            <div>
                <ol>
                    <li></li>
                </ol>
            </div>
        </>
     )
}
export default App;
